import Navbar from "./componenets/navBar/NavBar";
import './App.css';
import Intro from "./intro/intro";


function App() {
  return (
    <div className="App">
      <Navbar/>
      <Intro/>
      <a href="https://iconscout.com/3ds/react" target="_blank">Free React Logo 3D Icon</a> by <a href="https://iconscout.com/contributors/tomsdesign">Toms Design</a> on <a href="https://iconscout.com">IconScout</a>

    </div>
  );
}

export default App;
